def create_structure_mapping(structure_rows, structure_cols):
    mapping = {}
    for i, row in enumerate(structure_rows):
        for j, col in enumerate(structure_cols):
            classification = f"{col}，凹面{row}"
            mapping[classification] = (i, j)
    return mapping

# data.xlsx转化为固定分类项
def extract_classification(row, replacement_rules):
    clz = row[1].strip() + ',' + re.sub(r'/#[^/]*', '', row[2]).strip().replace(",", "，").replace("＋", "+")
    for rule in replacement_rules:
        from_str, to_str = rule.split('|')
        clz = clz.replace(from_str, to_str)

    if row[0] == '筒瓦' and row[1] == '瓦头': #不管是什么瓦舌，去掉瓦舌的部分
        if '凸面素面' in clz and '外素面' not in clz:
            return "瓦头,不明，" + clz[clz.find('凹面'):]
        elif '凸面不明' in clz or '不明瓦舌' in clz:
            return "瓦头,不明，" + clz[clz.find('凹面'):]
        elif '凸面特殊' in clz:
            return "瓦头,特殊，" + clz[clz.find('凹面'):]

    return clz.replace("凸面", "")

def process_data(data, replacement_rules):
    tongwa_data = {}
    banwa_data = {}

    for row in data:
        category = row[0]
        if category not in ["筒瓦", "板瓦"] or pd.isna(row[6]) or pd.isna(row[7]):
            continue

        classification = extract_classification(row, replacement_rules)
        quantity = int(row[6])
        weight = float(row[7])

        target_dict = tongwa_data if category == "筒瓦" else banwa_data

        if classification not in target_dict:
            target_dict[classification] = {"quantity": 0, "weight": 0.0}

        target_dict[classification]["quantity"] += quantity
        target_dict[classification]["weight"] += weight

    return tongwa_data, banwa_data

# 大表填写
def write_excel_template(base64_data, output_path):
    os.makedirs(os.path.dirname(output_path), exist_ok=True)
    decoded_data = base64.b64decode(base64_data)
    
    with open(output_path, "wb") as output_file:
        output_file.write(decoded_data)

def write_to_excel(t, data, structure_rows, structure_cols, start_position, output_path, header_info):
    wb = openpyxl.load_workbook(output_path)
    mapping = create_structure_mapping(structure_rows, structure_cols)

    for idx, sheet_name in enumerate(["数量表", "重量表"]):
        ws = wb[sheet_name]

        for cell, value in header_info.items():
            ws[cell] = value

        for classification, values in data.items():
            if classification not in mapping:
                user_input = input(f"【{t}{classification.replace(',', '，凸面')}】不存在，是否忽略该项继续填表？(y/n): ")
                if user_input.lower() != 'y':
                    raise ValueError(f"分类标准不存在")
                continue

            row_idx, col_idx = mapping[classification]
            row = start_position[0] + row_idx
            col = start_position[1] + col_idx

            if idx == 0:
                ws.cell(row=row, column=col, value=values["quantity"])
            else:
                ws.cell(row=row, column=col, value=values["weight"])

    wb.save(output_path)

def main():
    try:
        #sourceFolder = sys.argv[1]
        exportFolder = sys.argv[4]
        formFile = sys.argv[2]
        sheetName = sys.argv[3]
        replacement_rules_str = sys.argv[-1]  # 最后一个参数是替换规则
        replacement_rules = replacement_rules_str.split('||')

        # 格式化data.xlsx
        if not os.path.exists(formFile):
            raise FileNotFoundError("data.xlsx 文件不存在！")

        data = pd.read_excel(formFile, sheet_name=sheetName, header=None).values.tolist()

        if data[0][0] not in ["板瓦", "筒瓦", "不明"]:
            raise ValueError("data.xlsx 包含表头，请删除后重新运行程序！")

        tongwa_data, banwa_data = process_data(data, replacement_rules)

        # 表头填写
        tanfang_number = sys.argv[5]
        yiji_unit_number = sys.argv[6]
        
        tongwa_header = {
            "B3": tanfang_number,
            "D3": yiji_unit_number,
        }
        banwa_header = {
            "C3": tanfang_number,
            "F3": yiji_unit_number,
        }

        tongwa_output = os.path.join(exportFolder, f"{tanfang_number}{yiji_unit_number}筒瓦表.xlsx")
        banwa_output = os.path.join(exportFolder, f"{tanfang_number}{yiji_unit_number}板瓦表.xlsx")

        if os.path.exists(tongwa_output):
            os.remove(tongwa_output)

        if os.path.exists(banwa_output):
            os.remove(banwa_output)

        if tongwa_data:
            write_excel_template(tongwa_base64, tongwa_output)
            write_to_excel('筒瓦', tongwa_data, tongwa_structure_rows, tongwa_structure_cols, (9, 4), tongwa_output, tongwa_header)
        
        if banwa_data:
            write_excel_template(banwa_base64, banwa_output)
            write_to_excel('板瓦', banwa_data, banwa_structure_rows, banwa_structure_cols, (9, 3), banwa_output, banwa_header)

        print("表格已导出")

    except Exception as e:
        print(f"发生错误：{e}")
    finally:
        input("输入任意键继续...")

if __name__ == "__main__":
    main()
